#include <iostream>
#include <cmath>
using namespace std;

int main()
{
    int m;
    cin >> m;
    int k = 0;
    for (int n = 1; n <= 100000; n++)
    {
        if (n % 10000 == 0)
        {
            cout << n << " ";
        }
        if (n % 10 == 0)
        {
            k++;
        }
    }
    cout << endl;
    for (int n = 1; n <= 100000; n++)
    {
        if (n % 10000 == 0)
        {
            cout << n << " ";
        }
        if (n % 10 == 0)
        {
            k--;
        }
        if (k == m)
        {
            cout << n << endl;
        }
    }
    return 0;
}

