import sys

def factorial(n):
    if n == 0:
        return 1
    else:
        return n * factorial(n - 1)

m = int(sys.stdin.readline())
count = 0
for i in range(1, 100001):
    if factorial(i) % 10 ** m == 0:
        count += 1

print(count)

for i in range(1, 100001):
    if factorial(i) % 10 ** m == 0:
        print(i)

